import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 18.2-152.5:1 Using a computer to gather identifying information; penalties.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/18.2-152.5:1.md","filePath":"vacode/18.2-152.5:1.md"}'),r={name:"vacode/18.2-152.5:1.md"},n=a('<h1 id="§-18-2-152-5-1-using-a-computer-to-gather-identifying-information-penalties" tabindex="-1">§ 18.2-152.5:1 Using a computer to gather identifying information; penalties. <a class="header-anchor" href="#§-18-2-152-5-1-using-a-computer-to-gather-identifying-information-penalties" aria-label="Permalink to &quot;§ 18.2-152.5:1 Using a computer to gather identifying information; penalties.&quot;">​</a></h1><p>A. It is unlawful for any person, other than a law-enforcement officer, as defined in § <a href="http://law.lis.virginia.gov/vacode/9.1-101/" target="_blank" rel="noreferrer">9.1-101</a>, and acting in the performance of his official duties, to use a computer to obtain, access, or record, through the use of material artifice, trickery or deception, any identifying information, as defined in clauses (iii) through (xiii) of subsection C of § <a href="http://law.lis.virginia.gov/vacode/18.2-186.3/" target="_blank" rel="noreferrer">18.2-186.3</a>. Any person who violates this section is guilty of a Class 6 felony.</p><p>B. Any person who violates this section and sells or distributes such information to another is guilty of a Class 5 felony.</p><p>C. Any person who violates this section and uses such information in the commission of another crime is guilty of a Class 5 felony.</p><p>2005, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0760" target="_blank" rel="noreferrer">760</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0761" target="_blank" rel="noreferrer">761</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0827" target="_blank" rel="noreferrer">827</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?051+ful+CHAP0837" target="_blank" rel="noreferrer">837</a>.</p>',5),o=[n];function s(l,f,c,g,h,p){return i(),t("div",null,o)}const u=e(r,[["render",s]]);export{_ as __pageData,u as default};
